import React from "react";
import homewarranty from"../assets/images/homewarranty.png";

const RealStateOrder =()=>{
    return(
        <>
        <div className="home_page">
            <div className="top_img">
                <img src={homewarranty} alt="homewarranty"/>
            </div>
             <div className="realstate"><h1>Real Estate Orders</h1></div>
            <div className="container">
              <section>
                 <div className="contentbox">
                     <form>
                    <label><input type="radio" value="apple"/>apple </label>
                    <label><input type="radio" value="banana" />banana </label>
                    <label><input type="radio" value="orange" />orange </label>
                     </form>
                 </div>   
              </section>
            </div>
        </div>
        </>
    )
};
export default RealStateOrder;
